&lt;p&gt;Por la compra ce esta consola, Hello te regala un Bono de $150.000 para que compres lo que quieras en www.diahello.com.&lt;/p&gt;
&lt;p&gt;Este bundle es ideal para los fans de PlayStation que est&aacute;n dando el salto a la &uacute;ltima generaci&oacute;n de consolas, ya que en este bundle encontrar&aacute;s todo lo necesario para vivir grandes aventuras y 3 meses gratis de PS Plus para que disfrutes de los beneficios de nuestra suscripci&oacute;n. Este bundle est&aacute; pensado para todos los miembros de la familia, ya que cuenta con 3 juegos diferentes.&lt;/p&gt;
&lt;p&gt;&nbsp;&lt;strong&gt;Horizon Zero Dawn:&lt;/strong&gt; En un exuberante mundo abierto postapocal&iacute;ptico, las colosales criaturas mecanizadas dominan un territorio que le han arrebatado a la humanidad. Eres Aloy, una h&aacute;bil cazadora que depende de su velocidad, astucia y agilidad para sobrevivir y proteger a su tribu contra la fuerza, el tama&ntilde;o y el poder&iacute;o bruto de las m&aacute;quinas.&lt;/p&gt;
&lt;p&gt;&lt;strong&gt;&nbsp;Uncharted - A Thief&#039;s End:&lt;/strong&gt; Varios a&ntilde;os despu&eacute;s de su &uacute;ltima aventura, el retirado cazador de fortunas, Nathan Drake, es obligado a regresar al mundo de los ladrones. Con intereses mucho m&aacute;s personales, Drake se embarca en un viaje alrededor del mundo persiguiendo una conspiraci&oacute;n hist&oacute;rica conectada con un legendario tesoro pirata. Su mejor aventura probar&aacute; sus l&iacute;mites f&iacute;sicos, su capacidad de resoluci&oacute;n, y en definitiva qu&eacute; est&aacute; dispuesto a sacrificar para salvar a sus seres amados.&lt;/p&gt;
&lt;p&gt;&nbsp;&lt;strong&gt;God of War Remasterizado:&lt;/strong&gt; El modo foto de God of War III Remasterizado permitir&aacute; a los jugadores congelar, editar y compartir fotos de toda la sorprendente acci&oacute;n de Kratos Los jugadores luchar&aacute;n en mundos tridimensionales &uacute;nicos y detallados, iluminados por miles de luces din&aacute;micas y con una mayor resoluci&oacute;n Mejores gr&aacute;ficos que permiten vivir un extremo realismo, apreciar las estr&iacute;as de los m&uacute;sculos, expresiones faciales detalladas y nuevos niveles con m&aacute;s brutalidad y violencia Nuevas armas mortales tales como el Cestus (poderosos guantes de metal con una fuerza devastadora) y otros instrumentos brutales de guerra que permitir&aacute;n a Kratos aprender nuevas t&eacute;cnicas.&lt;/p&gt;
&lt;p&gt;&nbsp;Caracter&iacute;sticas:&lt;/p&gt;
